import React from "react";
import { Img, Text, Button } from "components";
import { useNavigate } from "react-router-dom";

import "./LandingPageNavbar.css"; // Import CSS file

const LandingPageNavbar = (props) => {
  const navigate = useNavigate();

  return (
    <>
      <div className={props.className}>
        <div className="navbar-logo" onClick={() => navigate("/")}>
          <Img
            src="images/img_image1.png"
            className="h-9 md:h-auto object-cover w-[37px]"
            alt="imageOne"
          />
          <Text as="h6" variant="h6">
            {props?.waffle}
          </Text>
        </div>
        <div className="navbar-product">
          <Text
            variant="body3"
            onClick={() => navigate("/#product")}
          >
            {props?.product}
          </Text>
        </div>
        <div className="navbar-news">
          <Text
            variant="body3"
            onClick={() => navigate("/newsfeed")}
          >
            {props?.readnews}
          </Text>
        </div>
        <Button
          className="navbar-button"
          onClick={() => navigate("/waitlist")}
          shape="RoundedBorder10"
          size="md"
          variant="FillOrangeA100"
        >
          {props?.joinWaitlist}
        </Button>
      </div>
    </>
  );
};

LandingPageNavbar.defaultProps = {
  waffle: "Waffle.",
  product: "Product",
  readnews: "Read News",
  joinWaitlist: "Join waitlist",
};

export default LandingPageNavbar;
